tion:&lt;/b&gt; @destination &lt;/p&gt;\n                &lt;p&gt;&lt;b&gt;Bandwidth:&lt;/b&gt; @bandwidth_text / s&lt;/p&gt;\n            &lt;/div&gt;\n            "},"id":"1179","type":"HoverTool"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 54.06 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 511 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 5306.51 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 789.54 s &lt;/li&gt;\n&lt;li&gt; transfer time: 15.12 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.32.2.21:38621 &lt;/li&gt;\n          &lt;li&gt; Workers: 128 &lt;/li&gt;\n          &lt;li&gt; Threads: 128 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.86 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_jobqueue import SLURMCluster\nfrom distributed import Client\n\nfrom dask.distributed import performance_report, get_task_stream\n\n#import logging\n#logging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\ncores = 32\nnodes = 4\n\ncluster = SLURMCluster(memory          = '{}g'.format(16*cores),\n                       processes       = cores,\n                       name            = 'testdask-${JOB_ID}',\n                       cores           = cores,\n                       queue           = 'photon',\n                       local_directory = '/tmp',\n                       death_timeout   = '100000000000s',\n                       walltime        = '01:00:00',\n                       header_skip     = ['-n 1'], \n                       env_extra       = ['JOB_ID=${SLURM_ARRAY_JOB_ID}_${SLURM_ARRAY_TASK_ID}'],\n                       job_extra       = ['--ntasks-per-node=1', '--array=0-{}'.format(nodes-1), '--exclusive']) \n\ncluster.scale(jobs=1)\nclient = Client(cluster)\n\nclient.get_versions(check=True)\n\n\n#import pdb; pdb.set_trace() \n#client.upload_file('../../root/root_rdfenv-ucx-2/lib/DistRDF/Backends/Dask/Backend.py')\n\nimport ROOT\nROOT.gROOT.SetBatch(True)\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\n\n\ndef dimuonSpectrum(df):\n\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\"Dimuon_mass\", \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    hist.GetValue() # triggers the event loop\n\n\nif __name__ == '__main__':\n    \n    #filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, 101)]\n    #df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client) \n   \n    #import pdb; pdb.set_trace()\n   \n    for r in range(2):\n        filelist = [\"input_files/dimuon/f{}.root\".format(i+r) for i in range(1, 101)]\n        df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client)\n        client.wait_for_workers(cores*nodes)\n        with performance_report(filename=\"dask-report100-cold_present_{}.html\".format(r)):\n            dimuonSpectrum(df)\n        with performance_report(filename=\"dask-report100-hot_present_{}.html\".format(r)):\n            dimuonSpectrum(df)\n\n    client.close()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"tools":[{"id":"1386"},{"id":"1387"},{"id":"1388"}]},"id":"1389","type":"Toolbar"},{"attributes":{},"id":"1471","type":"YearsTicker"},{"attributes":{"child":{"id":"1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth by Worker"},"id":"1153","type":"Title"},{"attributes":{"color_mapper":{"id":"1151"},"coordinates":null,"formatter":{"id":"1177"},"group":null,"label_standoff":12,"location":[0,0],"major_label_policy":{"id":"1449"},"ticker":{"id":"1178"}},"id":"1176","type":"ColorBar"},{"attributes":{},"id":"1458","type":"Selection"},{"attributes":{"axis":{"id":"1163"},"coordinates":null,"group":null,"ticker":null},"id":"1165","type":"Grid"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1308"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1310"},"nonselection_glyph":{"id":"1309"},"view":{"id":"1312"}},"id":"1311","type":"GlyphRenderer"},{"attributes":{},"id":"1448","type":"AllLabels"},{"attributes":{"overlay":{"id":"1060"}},"id":"1057","type":"BoxZoomTool"},{"attributes":{},"id":"1167","type":"CategoricalTicker"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1275"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1277"},"nonselection_glyph":{"id":"1276"},"view":{"id":"1279"}},"id":"1278","type":"GlyphRenderer"},{"attributes":{"tools":[{"id":"1234"},{"id":"1235"},{"id":"1236"}]},"id":"1237","type":"Toolbar"},{"attributes":{"days":[1,4,7,10,13,
